import React, { useState, useEffect } from 'react';

import './dashboard.sass'


const Dashboard = () => {

  const [data, setData] = useState()

  const books = [
    {
      title: "qwerty",
      author: "ytrewq",
      category: "history",
      isbn: "1234567890",
    },
    {
      title: "qwerty",
      author: "ytrewq",
      category: "history",
      isbn: "1234567890",
    },
    {
      title: "qwerty",
      author: "ytrewq",
      category: "history",
      isbn: "1234567890",
    }
  ];

  return (
    <div className="dashboard">
      <h1>Book List</h1>
      <table className='table'>
        <thead>
          <tr>
            <th>Book title</th>
            <th>Author name</th>
            <th>Category</th>
            <th>ISBN</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {books.map((item, index) => {
            return (
              <tr>
                <th>{item.title}</th>
                <th>{item.author}</th>
                <th>{item.category}</th>
                <th>{item.isbn}</th>
                <th>
                  <button>Ed</button>
                  <button>Del</button>
                </th>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Dashboard
